import pdfkit
from jinja2 import Template

path_wkhtmltopdf = r'C:\Program Files\wkhtmltopdf\bin\wkhtmltopdf.exe'
config = pdfkit.configuration(wkhtmltopdf=path_wkhtmltopdf)


def main():
    edit_html_file()


def export_html_to_pdf(path_file_html):
    path_output = r'.\receipt\receipt.pdf'
    pdfkit.from_file(path_file_html, path_output, configuration=config)


def edit_html_file():
    with open(r'.\receipt\receipt_src.html', "r", encoding="utf8") as html_file:
        html_filedata = html_file.read()

    order = {"products": [{"did": "D9KDbD0FNjr2EYGuuJkt", "name": "my_product_name",
                           "description": "hi its for free cuz you have no money", "image_url_list": [
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,"],
                           "status": 0, "amount": 6, "reserved": 1338}], "date": "2023-03-01T09:07:04.072000+00:00",
             "address": "herzelia", "name": "pickup1"}

    template = Template(html_filedata).render(order)

    path_output = r'.\receipt\receipt_output.html'
    with open(path_output, "w", encoding="utf8") as html_file:
        html_file.write(template)
    export_html_to_pdf(path_output)


if __name__ == '__main__':
    main()
